import React from 'react'
import Avatar from '@mui/material/Avatar';
import "./header.css";

const Header = () => {
  return (
    <>
        <header>
            <nav><h1>Personal Trainer Web</h1>
                <div className='avatar'>
                <Avatar>H</Avatar>
                </div>
            </nav>
        </header>
    </>
  )
}

export default Header
